import React from 'react';

const CharacterDevelopment = () => {
  return (
    <div className="character-development-page">
      <h1>Character Development</h1>
      <p>
        At our school, we emphasize values like integrity, respect, and responsibility in all aspects of school life. 
        Through our mentorship programs, students learn to become compassionate and responsible individuals.
      </p>
      <p>
        Our programs include leadership workshops, community service initiatives, and peer mentoring to foster personal growth.
      </p>
      <button onClick={() => window.history.back()} className="modern-btn">Go Back</button>
    </div>
  );
};

export default CharacterDevelopment;
